import { Form, Field } from 'react-final-form'
import { useDispatch} from 'react-redux';
import { useHistory } from "react-router-dom";
import { updateObject } from '../actions/updateObject'

const RequestVacation = () => {

    const dispatch = useDispatch();    
    const history = useHistory();

    const onSubmit = values => {
      dispatch(updateObject({object: "team", data: values}))
    }

    return (
        <Form
        onSubmit={onSubmit}
        initialValues={
            {

            }
        }
        render={({ handleSubmit, form, values }) => (
          <form 
            className="service-form-wrapper"
            onSubmit={handleSubmit}
          >
            <div className="form-header email-form-boundaries">
              REQUEST VACATION
            </div>
            <div className="formFieldsWrapper">
            <div className="formFieldWrapper">
                <label className="formLabel">FIRST DAY:</label>
                <Field
                  className="formTextInput formTextUpdateInput" 
                  name="firstDay"
                  component="input"
                  type="date"
                />
              </div>
              <div className="formFieldWrapper">
                <label className="formLabel">LAST DAY:</label>
                <Field
                  className="formTextInput formTextUpdateInput" 
                  name="lastDay"
                  component="input"
                  type="date"
                />
              </div>
            </div>   

            <div className="formButtonsWrapper">
                <button
                    className="formButton formServiceButton"
                    type="button"
                    onClick={form.reset}
                >
                    RESET

                </button>
                <button
                    className="formButton formServiceButton"
                    type="button"
                >
                    CHANGE
                </button>

            </div>
          </form>
        )}
      />
    )


}
export default RequestVacation;
